export class Zapatilla {
  
    public nombre:string;
    public precio:number;
    public marca:string;
    public color:string;
    public stock:boolean;

    constructor(string:nombre, number:precio, marca, color, stock){
        this.nombre = nombre;
        this.precio = this.precio;
        this.marca = marca;
        this.color = color;
        this.stock = stock;
    }
}
